import React from "react";
import styled from "styled-components";

import Solution from "./Solution";

const WrapperMenuPlegable = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
`;

const TitleSection = styled.h2``;

const WrapperSolutions = styled.div`
	display: flex;
`;

class Develop extends React.Component {
	render() {
		return (
			<WrapperMenuPlegable>
				<TitleSection>One product, three solutions</TitleSection>
				<WrapperSolutions>
					<Solution> </Solution>
					<Solution> </Solution>
					<Solution> </Solution>
				</WrapperSolutions>
			</WrapperMenuPlegable>
		);
	}
}

export default Develop;
